import React from 'react'
import {FooterContainer, Mensagem} from './styled'

const Footer = () =>{
    return(
        <FooterContainer>
            <Mensagem>mensagem</Mensagem>
            <div>github e linkedin</div>
            <div>Desenvolvimento</div>
        </FooterContainer>

    )
}
export default Footer
